import React from "react";
import golf from "./golf1.jpg";

function Hero() {
  return (
    <div class="flex items-center justify-center pt-10">
      <div class="flex items-center justify-between text-white">
        <div class="flex flex-col ml-20 mx-20">
          <span class="text-2xl  font-bold text-blue-700 md:text-6xl">
            The new e-Golf
          </span>
          <p className="text-gray-400 text-xs uppercase">__Read more</p>
          <a href="/#"></a>
          {/**
           * <p className="text-gray-400 text-sm">Electric never felt so good.</p>
           */}
        </div>
        <img
          src={golf}
          alt="The new e-Golf"
          className="w-full h-full object-contain md:object-scale-down"
        ></img>
      </div>
    </div>
  );
}

export default Hero;
